import React from 'react'
import Student from './Student'
import { Link } from 'react-router-dom'

const Students= ({students, updateStudent}) => {
//  const renderStudents =  students.map(student => <Student key={student.id} student={student} updateStudent={updateStudent}/>)
const renderStudents = Object.keys(students).map(studentId =>
    <p><Link key={studentId} to={`/students/${studentId}`}>{ students[studentId].name }</Link></p>
  );
  return (
  <ul>
    {renderStudents}
    </ul>
  )
}

export default Students;
